import React from 'react';
import { connect } from 'react-redux';
import { getVehicles } from './redux/vehicleDatabase';
import './assets/scss/database.scss';

class Database extends React.Component {
    constructor() {
        super();
        this.state = {
            id: ''
        }
    }
    componentDidMount() {
        this.props.getVehicles();
    }
    handleClick = (id) => {
        this.setState({
            id: id
        })
    }
    showVehicles = () => {
        return this.props.vehicleDatabase.map(vehicle => (
            <div key={vehicle._id} className="database-container" onClick={() => this.handleClick(vehicle._id)}>
                <div className="database-header-container">
                    <h2> {vehicle.year} {vehicle.make} {vehicle.model} {vehicle.style} </h2>
                </div>
                {this.state.id === vehicle._id
                ?
                <div className="database-information-container">
                    <div className="database-row">
                        <p> Year: </p>
                        <p> {vehicle.year} </p>
                    </div>
                    <div className="database-row">
                        <p> Make: </p>
                        <p> {vehicle.make} </p>
                    </div>
                    <div className="database-row">
                        <p> Model: </p>
                        <p> {vehicle.model} </p>
                    </div>
                    <div className="database-row">
                        <p> Trim: </p>
                        <p> {vehicle.style} </p>
                    </div>
                    <div className="database-row">
                        <p> UVC: </p>
                        <p> {vehicle.uvc} </p>
                    </div>
                    <div className="database-row">
                        <p> VIN: </p>
                        <p> {vehicle.vin} </p>
                    </div>
                    <div className="database-row">
                        <p> MILES: </p>
                        <p> {vehicle.miles} </p>
                    </div>
                    {vehicle.files.length > 0 
                    ? 
                    <div className="database-column">
                        <p> Images: </p> 
                        <p> {vehicle.files.map(file => (
                            <img src={file} key={file} className="database-images" alt={vehicle.make}/>
                            ))} 
                        </p>
                    </div>
                    : null}
                    <div className="database-row">
                        <p> Name: </p>
                        <p> {vehicle.name} </p>
                    </div>
                    <div className="database-row">
                        <p> Email: </p>
                        <p> {vehicle.from} </p>
                    </div>
                    <div className="database-row">
                        <p> Phone: </p>
                        <p> {vehicle.phone} </p>
                    </div>
                    <div className="database-row">
                        <p> ZIP: </p>
                        <p> {vehicle.zip} </p>
                    </div>
                </div>
                : null}
            </div>
        ))
    }
    render() {
        return (
            <div className="database-page">
                {this.showVehicles()}
            </div>
        )
    }
}

export default connect(state => state, { getVehicles })(Database)
